import React from 'react';
import { Create, SimpleForm, TextInput, NumberInput } from 'react-admin';

function addUsers(){
    return(
        <div className='addUserBody'>
            <Create>
                <SimpleForm>
                    <TextInput source="title" />
                    <NumberInput source="nb_views" />
                </SimpleForm>
            </Create>
        </div>
    )
}
export default addUsers;
